// SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.0;

import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

contract nUSD is Ownable {
    using SafeERC20 for IERC20;

    string public name;
    string public symbol;
    uint8 public decimals;
    uint256 public totalSupply;

    mapping(address => uint256) public balanceOf;
    mapping(address => uint256) public ethBalance;

    AggregatorV3Interface internal priceFeed;
    uint256 public usdToEthRate;

    event Deposit(address indexed from, uint256 ethAmount, uint256 nusdAmount);
    event Redeem(address indexed from, uint256 nusdAmount, uint256 ethAmount);

    constructor() {
        name = "nUSD";
        symbol = "nUSD";
        decimals = 18;
        totalSupply = 0;
        priceFeed = AggregatorV3Interface(0x694AA1769357215DE4FAC081bf1f309aDC325306);
    }

    function getEthPrice() internal view returns (uint256) {
        (, int256 price, , ,) = priceFeed.latestRoundData();
        return uint256(price);
    }

    function deposit() external payable {
        require(msg.value > 0, "Invalid deposit amount");

        uint256 ethPrice = getEthPrice();
        uint256 usdAmount = (msg.value * ethPrice) / usdToEthRate;
        uint256 nusdAmount = (usdAmount * (10**decimals)) / ethPrice;

        balanceOf[msg.sender] += nusdAmount;
        ethBalance[msg.sender] += msg.value;
        totalSupply += nusdAmount;

        emit Deposit(msg.sender, msg.value, nusdAmount);
    }

    function redeem(uint256 _amount) external {
        require(balanceOf[msg.sender] >= _amount, "Insufficient balance");

        uint256 ethPrice = getEthPrice();
        uint256 usdAmount = (_amount * ethPrice) / (10**decimals);
        uint256 ethAmount = (usdAmount * usdToEthRate) / ethPrice;

        balanceOf[msg.sender] -= _amount;
        ethBalance[msg.sender] -= ethAmount;
        totalSupply -= _amount;

        payable(msg.sender).transfer(ethAmount);

        emit Redeem(msg.sender, _amount, ethAmount);
    }

    function setUSDToEthRate(uint256 _rate) external onlyOwner {
        require(_rate > 0, "Invalid rate");
        usdToEthRate = _rate;
    }

    function withdrawETH(uint256 _amount) external onlyOwner {
        require(_amount <= address(this).balance, "Insufficient contract balance");
        payable(owner()).transfer(_amount);
    }

    function withdrawToken(address _token, uint256 _amount) external onlyOwner {
        IERC20 token = IERC20(_token);
        require(_amount > 0, "Invalid amount");
        require(_amount <= token.balanceOf(address(this)), "Insufficient token balance");
        token.safeTransfer(owner(), _amount);
    }
}

